import React, { useState } from 'react';

export default function Contact(){
  const [msg, setMsg] = useState('');
  const onSubmit = (e)=>{ e.preventDefault(); setMsg('Thanks! We will reach out soon.'); };
  return (
    <div className="max-w-lg mx-auto card">
      <h1 className="text-2xl font-bold mb-4">Contact Us</h1>
      {msg && <div className="bg-green-100 text-green-700 p-2 rounded mb-2">{msg}</div>}
      <form onSubmit={onSubmit} className="space-y-3">
        <input className="input" placeholder="Your name" />
        <input className="input" type="email" placeholder="Email" />
        <textarea className="input" placeholder="Message" />
        <button className="btn btn-primary w-full">Send</button>
      </form>
    </div>
  );
}
